e_msg_Envelope(#'Envelope'{loginReq = F1,
			   loginResp = F2, unusedConfigReq = F3,
			   configResp = F4, configRespDone = F5,
			   softwareUpdateReq = F6, deviceAlarm = F7,
			   deviceAction = F8, x509Update = F9,
			   sensorSample = F10, videoUploadReq = F11,
			   videoUploadResp = F12, timeReq = F13, timeResp = F14,
			   sensorSampleReq = F15, gpsSample = F16,
			   gpsActionReq = F17, gpsActionRsp = F18,
			   lightingForceState = F19, lightingSetAuto = F20,
			   lightingScheduledEvent = F21,
			   lightingAstronomicalEvent = F22,
			   lightingClearSchedule = F23},
	       Bin) ->
    B1 = if F1 == undefined -> Bin;
	    true ->
		e_mfield_Envelope_loginReq(F1, <<Bin/binary, 10>>)
	 end,
    B2 = if F2 == undefined -> B1;
	    true ->
		e_mfield_Envelope_loginResp(F2, <<B1/binary, 18>>)
	 end,
    B3 = if F3 == undefined -> B2;
	    true ->
		e_mfield_Envelope_unusedConfigReq(F3, <<B2/binary, 26>>)
	 end,
    B4 = if F4 == undefined -> B3;
	    true ->
		e_mfield_Envelope_configResp(F4, <<B3/binary, 34>>)
	 end,
    B5 = if F5 == undefined -> B4;
	    true ->
		e_mfield_Envelope_configRespDone(F5, <<B4/binary, 42>>)
	 end,
    B6 = if F6 == undefined -> B5;
	    true ->
		e_mfield_Envelope_softwareUpdateReq(F6,
						    <<B5/binary, 50>>)
	 end,
    B7 = if F7 == undefined -> B6;
	    true ->
		e_mfield_Envelope_deviceAlarm(F7, <<B6/binary, 58>>)
	 end,
    B8 = if F8 == undefined -> B7;
	    true ->
		e_mfield_Envelope_deviceAction(F8, <<B7/binary, 66>>)
	 end,
    B9 = if F9 == undefined -> B8;
	    true ->
		e_mfield_Envelope_x509Update(F9, <<B8/binary, 74>>)
	 end,
    B10 = if F10 == undefined -> B9;
	     true ->
		 e_mfield_Envelope_sensorSample(F10, <<B9/binary, 82>>)
	  end,
    B11 = if F11 == undefined -> B10;
	     true ->
		 e_mfield_Envelope_videoUploadReq(F11,
						  <<B10/binary, 90>>)
	  end,
    B12 = if F12 == undefined -> B11;
	     true ->
		 e_mfield_Envelope_videoUploadResp(F12,
						   <<B11/binary, 98>>)
	  end,
    B13 = if F13 == undefined -> B12;
	     true ->
		 e_mfield_Envelope_timeReq(F13, <<B12/binary, 106>>)
	  end,
    B14 = if F14 == undefined -> B13;
	     true ->
		 e_mfield_Envelope_timeResp(F14, <<B13/binary, 114>>)
	  end,
    B15 = if F15 == undefined -> B14;
	     true ->
		 e_mfield_Envelope_sensorSampleReq(F15,
						   <<B14/binary, 122>>)
	  end,
    B16 = if F16 == undefined -> B15;
	     true ->
		 e_mfield_Envelope_gpsSample(F16, <<B15/binary, 130, 1>>)
	  end,
    B17 = if F17 == undefined -> B16;
	     true ->
		 e_mfield_Envelope_gpsActionReq(F17,
						<<B16/binary, 138, 1>>)
	  end,
    B18 = if F18 == undefined -> B17;
	     true ->
		 e_mfield_Envelope_gpsActionRsp(F18,
						<<B17/binary, 146, 1>>)
	  end,
    B19 = if F19 == undefined -> B18;
	     true ->
		 e_mfield_Envelope_lightingForceState(F19,
						      <<B18/binary, 162, 1>>)
	  end,
    B20 = if F20 == undefined -> B19;
	     true ->
		 e_mfield_Envelope_lightingSetAuto(F20,
						   <<B19/binary, 170, 1>>)
	  end,
    B21 = if F21 == undefined -> B20;
	     true ->
		 e_mfield_Envelope_lightingScheduledEvent(F21,
							  <<B20/binary, 178,
							    1>>)
	  end,
    B22 = if F22 == undefined -> B21;
	     true ->
		 e_mfield_Envelope_lightingAstronomicalEvent(F22,
							     <<B21/binary, 186,
							       1>>)
	  end,
    if F23 == undefined -> B22;
       true ->
	   e_mfield_Envelope_lightingClearSchedule(F23,
						   <<B22/binary, 194, 1>>)
    end.

