verify_msg(Msg) ->
    case Msg of
      #'DeviceAlarm'{} ->
	  v_msg_DeviceAlarm(Msg, ['DeviceAlarm']);
      #'LightingClearSchedule'{} ->
	  v_msg_LightingClearSchedule(Msg,
				      ['LightingClearSchedule']);
      #'CalendarEvent'{} ->
	  v_msg_CalendarEvent(Msg, ['CalendarEvent']);
      #'LightingCtrl'{} ->
	  v_msg_LightingCtrl(Msg, ['LightingCtrl']);
      #'LightingScheduledEvent'{} ->
	  v_msg_LightingScheduledEvent(Msg,
				       ['LightingScheduledEvent']);
      #'X509UpdateReq'{} ->
	  v_msg_X509UpdateReq(Msg, ['X509UpdateReq']);
      #'LoginReq'{} -> v_msg_LoginReq(Msg, ['LoginReq']);
      #'VideoUploadReq'{} ->
	  v_msg_VideoUploadReq(Msg, ['VideoUploadReq']);
      #'LoginResp'{} -> v_msg_LoginResp(Msg, ['LoginResp']);
      #'ErrorResp'{} -> v_msg_ErrorResp(Msg, ['ErrorResp']);
      #'AstronomicalEvent'{} ->
	  v_msg_AstronomicalEvent(Msg, ['AstronomicalEvent']);
      #'LightingAstronomicalEvent'{} ->
	  v_msg_LightingAstronomicalEvent(Msg,
					  ['LightingAstronomicalEvent']);
      #'LightingSetAuto'{} ->
	  v_msg_LightingSetAuto(Msg, ['LightingSetAuto']);
      #'LightingForceState'{} ->
	  v_msg_LightingForceState(Msg, ['LightingForceState']);
      #'GpsActionRsp'{} ->
	  v_msg_GpsActionRsp(Msg, ['GpsActionRsp']);
      #'GpsActionReq'{} ->
	  v_msg_GpsActionReq(Msg, ['GpsActionReq']);
      #'GpsSample'{} -> v_msg_GpsSample(Msg, ['GpsSample']);
      #'SensorSampleReq'{} ->
	  v_msg_SensorSampleReq(Msg, ['SensorSampleReq']);
      #'TimeResp'{} -> v_msg_TimeResp(Msg, ['TimeResp']);
      #'TimeReq'{} -> v_msg_TimeReq(Msg, ['TimeReq']);
      #'VideoUploadResp'{} ->
	  v_msg_VideoUploadResp(Msg, ['VideoUploadResp']);
      #'SensorSample'{} ->
	  v_msg_SensorSample(Msg, ['SensorSample']);
      #'DeviceActionReq'{} ->
	  v_msg_DeviceActionReq(Msg, ['DeviceActionReq']);
      #'SoftwareUpdateReq'{} ->
	  v_msg_SoftwareUpdateReq(Msg, ['SoftwareUpdateReq']);
      #'ConfigRespDone'{} ->
	  v_msg_ConfigRespDone(Msg, ['ConfigRespDone']);
      #'KVPair'{} -> v_msg_KVPair(Msg, ['KVPair']);
      #'ConfigResp'{} ->
	  v_msg_ConfigResp(Msg, ['ConfigResp']);
      #'UnusedConfigReq'{} ->
	  v_msg_UnusedConfigReq(Msg, ['UnusedConfigReq']);
      #'Envelope'{} -> v_msg_Envelope(Msg, ['Envelope']);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


v_msg_DeviceAlarm(#'DeviceAlarm'{alarmType = F1,
				 alarmSeverity = F2, msg = F3},
		  Path) ->
    v_enum_AlarmType(F1, [alarmType | Path]),
    v_enum_AlarmSeverity(F2, [alarmSeverity | Path]),
    if F3 == undefined -> ok;
       true -> v_type_string(F3, [msg | Path])
    end,
    ok;
v_msg_DeviceAlarm(X, Path) ->
    mk_type_error({expected_msg, 'DeviceAlarm'}, X, Path).

